type CustomResolver struct {
	types map[string]protoreflect.MessageType
}

func (r *CustomResolver) FindMessageByURL(url string) (protoreflect.MessageType, error) {
	if t, ok := r.types[url]; ok {
		return t, nil
	}
	return nil, protoregistry.NotFound
}

func (r *CustomResolver) FindExtensionByName(field protoreflect.FullName) (protoreflect.ExtensionType, error) {
	return nil, protoregistry.NotFound
}

func (r *CustomResolver) FindExtensionByNumber(message protoreflect.FullName, field protoreflect.FieldNumber) (protoreflect.ExtensionType, error) {
	return nil, protoregistry.NotFound
}

func (r *CustomResolver) FindMessageByName(message protoreflect.FullName) (protoreflect.MessageType, error) {
	return nil, protoregistry.NotFound
}

